{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/yangle2912/eda-customer-data-analysis-by-r?scriptVersionId=129846070\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"40d44900","metadata":{"papermill":{"duration":0.023342,"end_time":"2023-05-16T23:24:51.611335","exception":false,"start_time":"2023-05-16T23:24:51.587993","status":"completed"},"tags":[]},"source":["# Customer shopping data EDA analysis\n","\n","**Subject**\n","1. Description of Dataset\n","\n","2. Examine Data:\n","* Load packages\n","* Getting Data from text files - comma delimited (.csv)\n","* With the “head” command, ensure that the data is loaded correctly.\n","* Count columns and rows\n","* Preprocess data: Reformat date and group customers’ age in 10’s (<20 years old), 20’s (20 to 30 years old), 30’s (30 to 40 years old), 40’s (40 to 50 years old), the rest is 60’s\n","* Summary of Dataset\n","\n","3. Preliminary descriptive statistics analysis:\n","* Summary statistics for numerical variables\n","* Number of unique levels for categorical variables\n","* Frequency table for categorical variables\n","* Measures of Variability\n","* Calculate standard deviation and variance of price\n","* Calculate interquartile range of price\n","* Distribution\n","\n","4. Develop box plots, histograms and frequency tables/charts:\n","* Develop box plots.\n","* Develop histograms.\n","\n","5. Choosing sub groups and plot some of these charts with faceting:\n","* Group and count customers by gender, age, category, shopping mall, payment_method\n","* By Gender and Shopping Mall\n","* By Age and Category\n","* By Category\n","* By Shopping Mall\n","* By Payment Method and age group\n","* Preferred category by age group by shopping mall (high spending)\n","* Preferred category by time series by shopping mall (high spending)\n","\n","6. Develop correlation plots for different combination of variables:\n","* Gender Spending\n","* Purchasing Behavior By Category\n","\n","7. Regression: \n","* Hypothesis 1: Age and Gender Impact Shopping Behavior\n","* Hypothesis 2: Payment Method Affects Purchase Amount\n","* Hypothesis 3: Shopping Mall Location Influences Purchase Frequency\n","* Hypothesis 4: Product Category Affects Purchase Amount\n","\n","> Thank you for coming before we begin."]},{"cell_type":"markdown","id":"d7d8f12f","metadata":{"papermill":{"duration":0.021836,"end_time":"2023-05-16T23:24:51.657666","exception":false,"start_time":"2023-05-16T23:24:51.63583","status":"completed"},"tags":[]},"source":["# 1. Description of Dataset:\n","\n","* This report illustrates an analysis of shopping data in Istanbul. The data is gathered from 10 different shopping malls between 2021 and 2023. Data is collected from various age groups and genders in Istanbul to provide a comprehensive view of shopping habits and gain valuable insights into shopping patterns. The dataset comprises invoice numbers, customer IDs, age, gender, payment methods, product categories, quantity, price, order dates, and shopping mall locations. The dataset has a broad scope; it offers numerous opportunities for a detailed analysis, for example identifying trends in customer demographics, understanding, predicting customer purchase behavior, and exploring relationships between data attributes. \n","* The intended purpose of data analysis is to understand and identify the trends in customer purchase behavior, analyze which products and payment methods are most frequently used by the customers, which malls customers have visited the most, and how different customer demographics come into play while they shop. Extracting such information can help make data-driven decisions, enhance the customer’s experience, evaluate potential product offerings, and improve opportunity areas. To be precise, this data analysis helps determine the factors that impact customer behavior across various demographic groups in Istanbul. "]},{"cell_type":"markdown","id":"ea45ad94","metadata":{"papermill":{"duration":0.020918,"end_time":"2023-05-16T23:24:51.699458","exception":false,"start_time":"2023-05-16T23:24:51.67854","status":"completed"},"tags":[]},"source":["# 2. Examine the data source. Get the data imported into R:"]},{"cell_type":"markdown","id":"61e857f4","metadata":{"papermill":{"duration":0.021747,"end_time":"2023-05-16T23:24:51.744073","exception":false,"start_time":"2023-05-16T23:24:51.722326","status":"completed"},"tags":[]},"source":["* Load packages & data:"]},{"cell_type":"code","execution_count":1,"id":"ba17ee48","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"execution":{"iopub.execute_input":"2023-05-16T23:24:51.793022Z","iopub.status.busy":"2023-05-16T23:24:51.789992Z","iopub.status.idle":"2023-05-16T23:24:56.999436Z","shell.execute_reply":"2023-05-16T23:24:56.996729Z"},"papermill":{"duration":5.238133,"end_time":"2023-05-16T23:24:57.004117","exception":false,"start_time":"2023-05-16T23:24:51.765984","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.0     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.1.8\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()