:420,"width":420}},"output_type":"display_data"}],"source":["customerDF %>% group_by(shopping_mall, age_group, category) %>% \n","  summarise(sales_USD = sum(total_sale*0.052/1000), .groups = \"drop\") %>% \n","  filter(category %in% c('Clothing','Shoes','Technology','Cosmetics')) %>%\n","  ggplot(aes(reorder(category, -sales_USD), sales_USD, color = age_group)) +\n","  geom_point() +\n","  facet_wrap(~ shopping_mall) + \n","  labs(title = 'Shopping malls preferred by customers by age group filtering top 4 categories',\n","       subtitle = '1 = 1,000$') +\n","xlab('Category') + ylab('Total Sales in USD') + guides(color = guide_legend(title = \"Age Group\")) +   theme_bw() +\n","  theme(plot.title = element_text(face = 'bold', size = 10, hjust = .5),\n","        strip.background.x = element_rect(fill = 'darkblue'),\n","        strip.text.x = element_text(face = 'bold', color = 'white', size = 7),\n","        axis.title = element_text(face = 'italic'),\n","        axis.text = element_text(face = 'bold', size = 7, angle = 20)) +\n","scale_fill_brewer(palette = 'Set1')"]},{"cell_type":"markdown","id":"c15e08c4","metadata":{"papermill":{"duration":0.052279,"end_time":"2023-05-16T23:25:20.189299","exception":false,"start_time":"2023-05-16T23:25:20.13702","status":"completed"},"tags":[]},"source":["> All 4 categories have a similar trend in every mall. In detail, the ‘40s (between 40 and 50 years old) customers and the ‘60s (more than 60 years old) purchase aggressively, followed by the ‘20s (between 20 and 30 years old) and the ‘50s (between 50 and 60 years old); yet the pattern varies between stores - for example: in Mall of Istanbul, the ‘40s and the ‘60s share the same power, while in Kanyon, the ‘40s has the more substantial purchasing power, which may be influenced by the demographic surrounding each mall."]},{"cell_type":"markdown","id":"5f8e83ce","metadata":{"papermill":{"duration":0.051735,"end_time":"2023-05-16T23:25:20.292313","exception":false,"start_time":"20