f -0.041 and the p-value of 0.967 indicate that Gender (Male) is not statistically significant in predicting the Number of customer purchases. This suggests that there is no significant difference in shopping behavior between genders.\n","\n","* Multiple R-squared and Adjusted R-squared: \n","The considerable R-squared value is 4.613e-07, which indicates that the model explains a tiny proportion of the variance in Quantity. The adjusted R-squared value is -1.965e-05, close to zero, suggesting that the model does not fit the data well.\n","\n","* F-statistic and p-value: \n","The F-statistic of 0.02294 with a p-value of 0.9773 indicates that the overall model is not statistically significant in predicting Quantity, as the p-value is greater than the significance level of 0.05.\n","\n","Based on these results, we can conclude that Age and Gender do not significantly impact shopping behavior in this dataset, as they are not statistically significant predictors of Quantity. \n"]},{"cell_type":"markdown","id":"d10f038f","metadata":{"papermill":{"duration":0.053419,"end_time":"2023-05-16T23:25:22.383151","exception":false,"start_time":"2023-05-16T23:25:22.329732","status":"completed"},"tags":[]},"source":["* **Hypothesis 2: Payment Method Affects Purchase Amount**"]},{"cell_type":"code","execution_count":33,"id":"47512807","metadata":{"execution":{"iopub.execute_input":"2023-05-16T23:25:22.491099Z","iopub.status.busy":"2023-05-16T23:25:22.48904Z","iopub.status.idle":"2023-05-16T23:25:23.344455Z","shell.execute_reply":"2023-05-16T23:25:23.341377Z"},"papermill":{"duration":0.913025,"end_time":"2023-05-16T23:25:23.348234","exception":false,"start_time":"2023-05-16T23:25:22.435209","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","Call:\n","lm(formula = price ~ payment_method, data = customerDF)\n","\n","Residuals:\n","   Min     1Q Median     3Q    Max \n","-685.6 -645.4 -483.7  509.5 4563.0 \n","\n","Coefficients:\n","                          Estimat